import React from "react";

export default function Visual({
  id,
  name,
  content,
  style,
  capitalization,
  alignment,
}) {
  const createClassName = () => {
    let newClass = capitalization + style + alignment;
    return newClass;
  };

  return <div dangerouslySetInnerHTML={{ __html: content }}></div>;
}
